import numpy as np

def sigmoid(x):
    return 1 / (1 + np.exp(-x))

def sigmoid_derivative(x):
    return x * (1 - x)

def train_neural_network(X, y, num_iterations=1000):
    weights1 = np.random.rand(X.shape[1], 4) 
    weights2 = np.random.rand(4, 1) 

    for iteration in range(num_iterations):
        layer0 = X
        layer1 = sigmoid(np.dot(layer0, weights1))
        layer2 = sigmoid(np.dot(layer1, weights2))

        layer2_error = layer2 - y
        layer2_delta = layer2_error * sigmoid_derivative(layer2)

        layer1_error = layer2_delta.dot(weights2.T)
        layer1_delta = layer1_error * sigmoid_derivative(layer1)

        weights2 -= layer1.T.dot(layer2_delta)
        weights1 -= layer0.T.dot(layer1_delta)

    return weights1, weights2

def predict_neural_network(X, weights1, weights2):
    layer0 = X
    layer1 = sigmoid(np.dot(layer0, weights1))
    layer2 = sigmoid(np.dot(layer1, weights2))
    return layer2

def algorithm(train_samples, train_parity, test_samples):
  train_samples = np.array(train_samples)
  train_parity = np.array(train_parity).reshape(-1, 1)

  weights1, weights2 = train_neural_network(train_samples, train_parity)

  predictions = predict_neural_network(test_samples, weights1, weights2)
  return (predictions > 0.5).astype(int).flatten()
